import React from 'react';
import {NavbarStyle, NavbarLink} from './Styles';

export default function Navbar() {

    if(localStorage.getItem('token')){
        return (
            <div>

            </div>
        );
    }


    return (
        <div>
            <NavbarStyle>
                <NavbarLink href="/">Home</NavbarLink>
                <NavbarLink href="/login">Login</NavbarLink>

            </NavbarStyle>
        </div>
    )
}
